import React from 'react';
import Navbar from './navbar.js';

function Dashboard() {
  return (
    <div className="h-screen flex justify-center items-center">
      {/* Vertical Navbar */}
      <div className="bg-gray-800 w-16 flex flex-col items-center justify-center">
        <button className="text-white py-3 px-4 mb-6 rounded-lg">Button 1</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg">Button 2</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg">Button 3</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg">Button 4</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg">Button 5</button>
      </div>
      <div className="w-4/5 h-4/5 bg-darkgrey rounded-xl shadow-xl p-8">
        {/* Content of your rectangle */}
      </div>
    </div>
  );
}

export default Dashboard;
